import logo from './logo.svg';
import './App.css';
import React, { Component } from 'react';

class App extends Component {
    constructor(props){
        super(props)
        this.state = {
            input: "",
            output: ""
        }
    }
  render() {
    return (
        <div>
          <p>Updated name:
          <input
            type="text"

          />
              {this.state.name}
            </p>
          <p>Change name:</p>
          <input
              type="text"
              onChange={e => {
                this.setState({
                  name: e.target.value
                });
              }}
          />
        </div>
    );
  }
}

export default App;
